import React, { Component } from 'react';
import {Badge, Card, CardBody, Col, Row} from 'reactstrap';
import DatePicker from "react-datepicker";

class Fdates extends Component {

    constructor(props) {
        super(props);
        this.state = {
          startDate: new Date(),
          endDate: new Date()
        };

        this.handleStartChange = date => {
          this.setState({
            startDate: date,
          });


      }

      this.handleEndChange = date => {
        this.setState({
          endDate: date,
        });
    }
  }
    render() {
        return (

        <div className="animated fadeIn">

                <br />  

                <strong>Get Reports Weekly/ Monthly Wise</strong><br/>
                <hr/>
                <div className="dates">
                  <strong><label> To: </label></strong> <DatePicker className = "start_date form-control" maxDate={this.state.startDate} selected={this.state.startDate} onChange={this.handleStartChange}/>

                  <strong> &nbsp;&nbsp;&nbsp; <label> Form:</label>&nbsp;</strong> <DatePicker className = "end_date form-control"  selected={this.state.endDate} onChange={this.handleEndChange}/>
                 &nbsp;&nbsp;&nbsp;<Badge className="mr-3" color="warning"><i class="fa fa-pencil fa-lg"></i>  Apply  </Badge>
                 </div>
                <hr/>


      </div>

        );
    }
}
export default Fdates;
